DROP TABLE USER_INFO;

CREATE TABLE USER_INFO(
USER_NUMBER INTEGER NOT NULL GENERATED ALWAYS AS IDENTITY (START WITH 1,INCREMENT BY 1),
USER_ID VARCHAR(20) NOT NULL,
USER_NAME VARCHAR(20),
GROUP_NAME VARCHAR(20) NOT NULL,
PASSWORD VARCHAR(20) NOT NULL,
DESCRIPTION VARCHAR(1000),
CREATE_DATE DATE,
PRIMARY KEY(USER_ID)
);

/* USER_INFO DATA */

DROP TABLE URL_LIST;

/* 환경명, Domain, 업무명, 제품종류(APACHE,WebtoB, JEUS, WebLogic), 사용여부, 설명,URL 주소 */
CREATE TABLE URL_LIST(
URL_NUMBER INTEGER NOT NULL GENERATED ALWAYS AS IDENTITY (START WITH 1,INCREMENT BY 1),
ENV_NAME VARCHAR (10) NOT NULL,
DOMAIN_NAME VARCHAR(20),
BUSINESS_NAME VARCHAR(20),
MW_TYPE VARCHAR(10) NOT NULL,
SOLUCTION_NAME VARCHAR(20) NOT NULL,
USE_YN CHAR(1) NOT NULL,
DESCRIPTION VARCHAR(40) NOT NULL,
URL VARCHAR(100) NOT NULL,
PRIMARY KEY(URL_NUMBER)
);

/* URL LIST Data */
